import React from "react";
import styled from "styled-components";
import Header from "./Header";

// css
const BannerContainer = styled.div`
  background: #3c415e;
`;

function Banner() {
  return (
    <BannerContainer>
      <Header />
    </BannerContainer>
  );
}

export default Banner;
